import React from "react";
import { Nav, NavLink, NavMenu } 
    from "./NavbarElements";
import './index.css';

  
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu>
      <div className="image">
      <img src="Photo/OIP (1).jpg" width="45" height="60px" alt="" className="d-inline-block mr-2" />
      <span className="text-uppercase font-weight-bold"> CITY HOSPITAL.</span>
      </div>
 {/* <button type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" 
    aria-expanded="false" aria-label="Toggle navigation" className="   

    navbar-toggler">
      <span className="navbar-toggler-icon"></span></button> */}
          <NavLink to="/Home" activeStyle><i class="fa fa-fw fa-home"></i>
            Home 
          </NavLink>
          <NavLink to="/contact" activeStyle><i class="fa fa-fw fa-envelope"></i>
            Contact Us
          </NavLink>
          <NavLink to="/Login" activeStyle><i class="fa fa-fw fa-user"></i>
            Login
          </NavLink>
          <NavLink to="/Appointment" activeStyle><i class="fa fa-calendar"></i>
            Appointment
          </NavLink>
        
        </NavMenu>
      </Nav>
    
    </>
  );
};
  
export default Navbar;
